        <div className='navbar'>

            <button>
                <Link to='/'>Home</Link>
            </button>
            <button>
                <Link to='/contact' dupa='dupa'>Kontakt</Link>
            </button>
            <button>
                <Link to='/Users'>Users</Link>

            </button>
        </div>
    )
}
